const Students = () => {

  const [students, setStudents] = useState([{}]);



  const getStudents = async () => {
    try {
      const response = await fetch("http://localhost:7834/");
      const data = response.json();

      setStudents(data);

      console.log(data);
    } catch (err) {
      console.error(err.message);
    }
  };


  useEffect(() => {
      getStudents();
    },[]
  )



  return (
    <>
    <div>Students</div>
    <p>{students}</p>
    </>
  )
}

export default Students
